### Summary of Core Topics, Concepts, Principles, and Equations

#### 1. **Simple Linear Regression (SLR)**
- **Concepts**: Modeling the relationship between a dependent variable and an independent variable using a linear approach.
- **Principles**: Transformation of variables (e.g., logarithmic transformation) to handle non-linear relationships.
- **Equations**:
  - Linear Regression Equation: \( y = \beta_0 + \beta_1 x + \epsilon \)
  - Logarithmic Transformation: \( \ln(y) = \beta_0 + \beta_1 \ln(x) + \epsilon \)
- **ANOVA**: Degrees of freedom for regression term in ANOVA table is 1.

#### 2. **Multiple Linear Regression (MLR)**
- **Concepts**: Modeling the relationship between a dependent variable and multiple independent variables.
- **Principles**: Using regression statistics like R-squared, adjusted R-squared, standard error, and ANOVA to evaluate the model.
- **Equations**:
  - Multiple Regression Equation: \( y = \beta_0 + \beta_1 x_1 + \beta_2 x_2 + \ldots + \beta_n x_n + \epsilon \)
  - Adjusted R-squared: \( \bar{R}^2 = 1 - \left( \frac{(1-R^2)(n-1)}{n-k-1} \right) \)
  - F-statistic: \( F = \frac{MS_{Regression}}{MS_{Residual}} \)

#### 3. **Logistic Regression**
- **Concepts**: Modeling the probability of a binary outcome based on one or more predictor variables.
- **Principles**: Using logistic function to model probabilities, evaluating model performance using metrics like accuracy, precision, and recall.
- **Equations**:
  - Logistic Regression Equation: \( \ln\left(\frac{p}{1-p}\right) = \beta_0 + \beta_1 x_1 + \beta_2 x_2 + \ldots + \beta_n x_n \)
  - Probability: \( p = \frac{1}{1 + e^{-(\beta_0 + \beta_1 x_1 + \beta_2 x_2 + \ldots + \beta_n x_n)}} \)
  - Accuracy: \( \frac{TP + TN}{TP + TN + FP + FN} \)
  - Precision: \( \frac{TP}{TP + FP} \)
  - Recall: \( \frac{TP}{TP + FN} \)

#### 4. **Demand Response Curve with Constant Price Elasticity**
- **Concepts**: Modeling the relationship between price and demand using elasticity.
- **Principles**: Using constant elasticity models to predict demand changes based on price changes.
- **Equations**:
  - Constant Elasticity Model: \( Q = C P^E \)
  - Elasticity: \( E = \frac{\% \Delta Q}{\% \Delta P} \)

